import FilterButton from '../FilterButton'
import { getYears } from '../../utils'

export default function LeftNav({ data, filterHandler, selectedFilters }) {
  const years = data && getYears(data)
  console.log('years', years)

  return (
    <>
      <h5>Filters</h5>
      <div className="filter-group">
        <h6>Launch Year</h6>
        <div className="button-group">
          {years.map((year, index) => (
            <FilterButton
              key={index}
              clickHandler={filterHandler}
              name="year"
              value={year}
              className={year === selectedFilters.year ? 'selected' : ''}
            />
          ))}
        </div>

        <h6>Successfull Launch</h6>
        <div className="button-group">
          <FilterButton
            clickHandler={filterHandler}
            name="launched"
            value="true"
            className={'true' == selectedFilters.launched ? 'selected' : ''}
          />
          <FilterButton
            clickHandler={filterHandler}
            name="launched"
            value="false"
            className={'false' == selectedFilters.launched ? 'selected' : ''}
          />
        </div>

        <h6>Successfull Landing</h6>
        <div className="button-group">
          <FilterButton
            clickHandler={filterHandler}
            name="landing"
            value="true"
            className={'true' == selectedFilters.landing ? 'selected' : ''}
          />
          <FilterButton
            clickHandler={filterHandler}
            name="landing"
            value="false"
            className={'false' == selectedFilters.landing ? 'selected' : ''}
          />
        </div>
      </div>
    </>
  )
}
